PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "migrations" ("id" integer primary key autoincrement not null, "migration" varchar not null, "batch" integer not null);
CREATE TABLE IF NOT EXISTS "users" ("id" integer primary key autoincrement not null, "name" varchar not null, "email" varchar not null, "email_verified_at" datetime, "password" varchar not null, "remember_token" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "password_reset_tokens" ("email" varchar not null, "token" varchar not null, "created_at" datetime, primary key ("email"));
CREATE TABLE IF NOT EXISTS "sessions" ("id" varchar not null, "user_id" integer, "ip_address" varchar, "user_agent" text, "payload" text not null, "last_activity" integer not null, primary key ("id"));
CREATE TABLE IF NOT EXISTS "cache" ("key" varchar not null, "value" text not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "cache_locks" ("key" varchar not null, "owner" varchar not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "jobs" ("id" integer primary key autoincrement not null, "queue" varchar not null, "payload" text not null, "attempts" integer not null, "reserved_at" integer, "available_at" integer not null, "created_at" integer not null);
CREATE TABLE IF NOT EXISTS "job_batches" ("id" varchar not null, "name" varchar not null, "total_jobs" integer not null, "pending_jobs" integer not null, "failed_jobs" integer not null, "failed_job_ids" text not null, "options" text, "cancelled_at" integer, "created_at" integer not null, "finished_at" integer, primary key ("id"));
CREATE TABLE IF NOT EXISTS "failed_jobs" ("id" integer primary key autoincrement not null, "uuid" varchar not null, "connection" text not null, "queue" text not null, "payload" text not null, "exception" text not null, "failed_at" datetime not null default CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS "jira_settings" ("id" integer primary key autoincrement not null, "jira_host" varchar not null, "api_token" text not null, "project_keys" text, "created_at" datetime, "updated_at" datetime, "jira_email" varchar);
CREATE TABLE IF NOT EXISTS "jira_projects" ("id" integer primary key autoincrement not null, "jira_id" varchar not null, "project_key" varchar not null, "name" varchar not null, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "jira_app_users" ("id" integer primary key autoincrement not null, "jira_account_id" varchar not null, "display_name" varchar not null, "email_address" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "jira_issues" ("id" integer primary key autoincrement not null, "jira_project_id" integer not null, "jira_id" varchar not null, "issue_key" varchar not null, "summary" text not null, "status" varchar not null, "assignee_jira_app_user_id" integer, "original_estimate_seconds" integer, "created_at" datetime, "updated_at" datetime, foreign key("jira_project_id") references "jira_projects"("id") on delete cascade, foreign key("assignee_jira_app_user_id") references "jira_app_users"("id") on delete set null);
CREATE TABLE IF NOT EXISTS "jira_worklogs" ("id" integer primary key autoincrement not null, "jira_issue_id" integer not null, "jira_app_user_id" integer not null, "jira_id" varchar not null, "time_spent_seconds" integer not null, "started_at" datetime not null, "created_at" datetime, "updated_at" datetime, foreign key("jira_issue_id") references "jira_issues"("id") on delete cascade, foreign key("jira_app_user_id") references "jira_app_users"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "jira_sync_histories" ("id" integer primary key autoincrement not null, "started_at" datetime not null, "completed_at" datetime, "status" varchar check ("status" in ('pending', 'in_progress', 'completed', 'failed')) not null default 'pending', "total_projects" integer not null default '0', "processed_projects" integer not null default '0', "total_issues" integer not null default '0', "processed_issues" integer not null default '0', "total_worklogs" integer not null default '0', "processed_worklogs" integer not null default '0', "total_users" integer not null default '0', "processed_users" integer not null default '0', "error_count" integer not null default '0', "error_details" text, "duration_seconds" integer, "triggered_by" integer not null, "sync_type" varchar check ("sync_type" in ('manual', 'scheduled')) not null default 'manual', "created_at" datetime, "updated_at" datetime, "progress_percentage" integer not null default '0', "current_operation" varchar, foreign key("triggered_by") references "users"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "jira_sync_logs" ("id" integer primary key autoincrement not null, "jira_sync_history_id" integer not null, "timestamp" datetime not null, "level" varchar check ("level" in ('info', 'warning', 'error')) not null default 'info', "message" text not null, "context" text, "entity_type" varchar check ("entity_type" in ('project', 'issue', 'worklog', 'user', 'system')), "entity_id" varchar, "operation" varchar check ("operation" in ('fetch', 'create', 'update')), "created_at" datetime, "updated_at" datetime, foreign key("jira_sync_history_id") references "jira_sync_histories"("id") on delete cascade);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "users_email_unique" on "users" ("email");
CREATE INDEX "sessions_user_id_index" on "sessions" ("user_id");
CREATE INDEX "sessions_last_activity_index" on "sessions" ("last_activity");
CREATE INDEX "jobs_queue_index" on "jobs" ("queue");
CREATE UNIQUE INDEX "failed_jobs_uuid_unique" on "failed_jobs" ("uuid");
CREATE UNIQUE INDEX "jira_projects_jira_id_unique" on "jira_projects" ("jira_id");
CREATE UNIQUE INDEX "jira_projects_project_key_unique" on "jira_projects" ("project_key");
CREATE UNIQUE INDEX "jira_app_users_jira_account_id_unique" on "jira_app_users" ("jira_account_id");
CREATE UNIQUE INDEX "jira_issues_jira_id_unique" on "jira_issues" ("jira_id");
CREATE UNIQUE INDEX "jira_issues_issue_key_unique" on "jira_issues" ("issue_key");
CREATE UNIQUE INDEX "jira_worklogs_jira_id_unique" on "jira_worklogs" ("jira_id");
CREATE INDEX "jira_sync_histories_status_index" on "jira_sync_histories" ("status");
CREATE INDEX "jira_sync_histories_started_at_index" on "jira_sync_histories" ("started_at");
CREATE INDEX "jira_sync_histories_triggered_by_index" on "jira_sync_histories" ("triggered_by");
CREATE INDEX "jira_sync_logs_jira_sync_history_id_index" on "jira_sync_logs" ("jira_sync_history_id");
CREATE INDEX "jira_sync_logs_level_index" on "jira_sync_logs" ("level");
CREATE INDEX "jira_sync_logs_entity_type_index" on "jira_sync_logs" ("entity_type");
CREATE INDEX "jira_sync_logs_timestamp_index" on "jira_sync_logs" ("timestamp");
COMMIT;
